import React from "react";
import useRandomNumber from "../radnomNumber/useRandomNumber";

const RandomFunction = () => {
  const [randomNumber, generateRandomNumber] = useRandomNumber(0);

  return (
    <div>
      <ul>
        {/* {randomNumbers.map((number, index) => (
          <li key={index}>{number}</li>
        ))} */}
        {randomNumber}
      </ul>

      <button
        onClick={() => {
          generateRandomNumber();
        }}
      >
        Add Random Number
      </button>
    </div>
  );
};

export default RandomFunction;
